import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
    appBar: {
        borderRadius: 15,
        margin: "15px 0",
        display: "flex",
        flexDirection: "row",
    },
    typography: {
        padding: "10px"
    }
}))
